import React, { useState } from 'react';
import './styles/Home.css';
import './styles/Mobile.css';

function Register() {
    const [pseudo, setPseudo] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [feeling_1, setFeeling_1] = useState('');
    const [feeling_2, setFeeling_2] = useState('');
    const [feeling_3, setFeeling_3] = useState('');
    const [feeling_4, setFeeling_4] = useState('');
    const [feeling_5, setFeeling_5] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
    
        // Ici, tu peux envoyer les données au backend ou gérer la logique de création du compte
        const userData = {
          pseudo,
          password,
          confirmPassword,
          feeling_1,
          feeling_2,
          feeling_3,
          feeling_4,
          feeling_5
        };
        
        console.log('User Data:', userData);
        // Effectuer l'envoi de ces données à l'API ou base de données
      };

    return (
        <div className="container">
            <div className="header">
                <h1>myDay</h1>
            </div>
            <form onSubmit={handleSubmit}>
                <h4>
                    <label htmlFor="pseudo" >Pseudo : </label>
                    <input className="login-input"
                    type="text"
                    id="pseudo"
                    name="pseudo"
                    value={pseudo}
                    onChange={(e) => setPseudo(e.target.value)}
                    required
                    placeholder=""
                    />
                </h4>
                <h4>
                    <label htmlFor="password" >Mot de pass : </label>
                    <input className="login-input"
                    type="password"
                    id="password"
                    name="password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    required
                    placeholder=""
                    />
                </h4>
                <h4>
                    <p>Confirmation : </p>
                    <label htmlFor="confirmPassword" >Mot de pass : </label>
                    <input className="login-input"
                    type="password"
                    id="confirmPassword"
                    name="confirmPassword"
                    value={confirmPassword}
                    onChange={(e) => setConfirmPassword(e.target.value)}
                    required
                    placeholder=""
                    />
                </h4>
                <h4>
                    <label htmlFor="feeling_1" >Feeling 1 : </label>
                    <input className="login-input"
                    type="text"
                    id="feeling_1"
                    name="feeling_1"
                    value={feeling_1}
                    onChange={(e) => setFeeling_1(e.target.value)}
                    required
                    placeholder=""
                    />
                </h4>
                <h4>
                    <label htmlFor="feeling_2" >Feeling 1 : </label>
                    <input className="login-input"
                    type="text"
                    id="feeling_2"
                    name="feeling_2"
                    value={feeling_2}
                    onChange={(e) => setFeeling_2(e.target.value)}
                    required
                    placeholder=""
                    />
                </h4>
                <h4>
                    <label htmlFor="feeling_3" >Feeling 3 : </label>
                    <input className="login-input"
                    type="text"
                    id="feeling_3"
                    name="feeling_3"
                    value={feeling_1}
                    onChange={(e) => setFeeling_(e.target.value)}
                    required
                    placeholder=""
                    />
                </h4>
                <h4>
                    <label htmlFor="feeling_4" >Feeling 4 : </label>
                    <input className="login-input"
                    type="text"
                    id="feeling_4"
                    name="feeling_4"
                    value={feeling_4}
                    onChange={(e) => setPseudo(e.target.value)}
                    required
                    placeholder=""
                    />
                </h4>
                <h4>
                    <label htmlFor="feeling_5" >Feeling 5 : </label>
                    <input className="login-input"
                    type="text"
                    id="feeling_5"
                    name="feeling_5"
                    value={feeling_5}
                    onChange={(e) => setPseudo(e.target.value)}
                    required
                    placeholder=""
                    />
                </h4>
                </form>
            <hr class="hr" />
            
            <button className="submit-button">Soumettre</button>
        </div>
    );
}

export default Register;
